import React from "react";

export default function Main() {
  return (
    <>
      <div
        className="text-white"
        style={{
          height: "75vh",
          padding: "5em",
          backgroundColor: "rgba(0, 0, 0, 0.98)",
          
        }}
      >
        <center>
          <p className=" h1 text-center text-white">
            An open source initiative for God and Light
          </p>
        </center>
      </div>
    </>
  );
}
